-- 表：Participation
DROP TABLE IF EXISTS Participation;

CREATE TABLE IF NOT EXISTS Participation (
    AthleteID VARCHAR (50),
    EventID   VARCHAR (50),
    Time      TIMESTAMP    NOT NULL,
    Medal     VARCHAR (10) CHECK (Medal IN ('Gold', 'Silver', 'Bronze') OR
                                  Medal IS NULL),
    PRIMARY KEY (
        AthleteID,
        EventID
    ),
    FOREIGN KEY (
        AthleteID
    )
    REFERENCES Athlete (Athlete_id),
    FOREIGN KEY (
        EventID
    )
    REFERENCES Event (EventID) 
);

